var abVideoTracking;
if (!abVideoTracking) abVideoTracking = (function() {
    return {
        init: function() {
            var players = [];
            var paused = [];
            try {
                for (x = 0; x < Object.keys(videojs.players).length; x++) {
                    var setPlayer = Object.keys(videojs.players)[x];
                    if (document.getElementById(setPlayer).classList.contains('video-js')) {
                        videojs.getPlayer(setPlayer).ready(function() {
                            ABDEPlayer = this;
                            ABDEPlayer.on("pause", onPause);
                            ABDEPlayer.on("play", onPlay);
                            ABDEPlayer.on("timeupdate", onTimeupdate);
                            ABDEPlayer.on("ended", onEnded);
                            players.push(ABDEPlayer);
                        });
                    }
                }
            } catch (err) {
                // console.log(err)
            }
            
            function onPlay(e) {
                var id = e.target.id;
                for (var i = 0; i < players.length; i++) {
                    if (players[i].id() == id) {
                        abVideoTracking.getAnalytics('play', players[i].mediainfo['name'], players[i].mediainfo['id'], players[i].mediainfo['duration'], players[i].currentTime());
                    }
                }
            }
         
            function onPause(e) {
                var id = e.target.id;
                for (var i = 0; i < players.length; i++) {
                  if (players[i].id() == id) {
                    abVideoTracking.getAnalytics('pause', players[i].mediainfo['name'], players[i].mediainfo['id'], players[i].mediainfo['duration'], players[i].currentTime());
                  }
                }
            }
            function onTimeupdate(e) {
                var id = e.target.id;
                for (var i = 0; i < players.length; i++) {
                    if (players[i].id() == id) {
                        abVideoTracking.getAnalytics('play', players[i].mediainfo['name'], players[i].mediainfo['id'], players[i].mediainfo['duration'], players[i].currentTime());
                    }
                }
            }
            function onEnded(e) {
                var id = e.target.id;
                for (var i = 0; i < players.length; i++) {
                    if (players[i].id() == id) {
                        abVideoTracking.getAnalytics('complete', players[i].mediainfo['name'], players[i].mediainfo['id'], players[i].mediainfo['duration'], players[i].currentTime());
                    }
                }
            }
        },
        getAnalytics: function(type, vName, vId, duration, time) {
            const newVideoObj = {
                videoName: vName,
                videoID: vId,
                duration: duration,
                interactions: {
                    type: type,
                    timePlayed: time
                }
            }
            digitalDataLayer.vidData = newVideoObj;
        },
        checkForVideojs: function() {
            var getClass = false;
            var vodeocardInterval = setInterval(function() {
                try {
                    getClass = (document.getElementsByClassName('video-js-launch')) ? true : false;
                } catch (e) {}
                if (getClass) {
                    abVideoTracking.init()
                    getClass = false;
                    clearInterval(vodeocardInterval);
                }
            }, 500);
        }
    };
})();
document.addEventListener("DOMContentLoaded", function () {
    abVideoTracking.init();
});
