document.addEventListener('DOMContentLoaded', function () {
  let kakaokey = document.getElementById('kakaotalk-sharing-btn');
  if (kakaokey != null) {
    let appkey = kakaokey.dataset.apikey;
    let appurl = kakaokey.dataset.appurl != null && kakaokey.dataset.appurl.length > 0 ? kakaokey.dataset.appurl : '';
    let imgurl = kakaokey.dataset.imgpath != null && kakaokey.dataset.imgpath.length > 0 ? kakaokey.dataset.imgpath : '';
    let title = kakaokey.dataset.title != null && kakaokey.dataset.title.length > 0 ? kakaokey.dataset.title : '';
    let desc = kakaokey.dataset.description != null && kakaokey.dataset.description.length > 0 ? kakaokey.dataset.description : '';

    Kakao.init(appkey);

    kakaokey.onclick = function () {
      const socialPlatForm = kakaokey.ariaLabel;
      if (window.digitalDataLayer?.mData?.insights) {
        window.digitalDataLayer.mData.insights.socialInteraction =
          socialPlatForm;
      }
      Kakao.Share.sendDefault({
        objectType: 'feed',
        content: {
          title: title,
          description: desc,
          imageUrl: imgurl,
          link: {
            mobileWebUrl: appurl,
            webUrl: appurl
          },
        }
      });
    }
  }
});
