(function () {
  const messageQueue = [];
  function handleMessage(e) {
    if (e.origin.indexOf('alliancebernstein.com') < 0) {
      return;
    }
    messageQueue.push(e.data);
    checkQueue();
  }

  function checkQueue() {
    if (document.readyState != 'loading') {
      updateFrames();
    } else {
      document.addEventListener('DOMContentLoaded', updateFrames);
    }
  }

  function handleResize(e) {
    document.querySelectorAll('iframe.abde-iframe[scrolling="no"]').forEach(function (frame) {
      frame.setAttribute('scrolling', 'auto');
    });
  }

  function updateFrames() {
    const frames = [].slice.call(document.querySelectorAll('iframe.abde-iframe'));
    messageQueue.forEach(function (data) {
      const frameById = document.querySelector('iframe.abde-iframe[data-frame-id="' + data.frameId + '"]');
      let frame = frames.find(function (f) {
        return f.getAttribute('src').indexOf(data.url) > -1;
      });

      if (frameById || frames.length == 1) {
        frame = frameById || frames[0];
      }

      if (frame) {
        frame.setAttribute('scrolling', 'no');
        frame.style.setProperty('height', data.height + 'px');
      }
    });
  }

  window.addEventListener('message', handleMessage);
  window.addEventListener('resize', handleResize);
})();
let abdeIframeHeight;
if (!abdeIframeHeight) abdeIframeHeight = (function () {
  return {
    init: function () {
      let iframes = document.querySelectorAll('iframe.abde-iframe');
      iframes.forEach(function (iframe) {
        let frameInterval = setInterval(function () {
          try {
            if (iframe.contentWindow.document.body.scrollHeight > 50) {
              iframe.style.height = (iframe.contentWindow.document.body.scrollHeight + 50) + 'px';
              iframe.setAttribute('height', '');
              clearInterval(frameInterval);
            }
          } catch (e) { }
        }, 500);
      });
    }
  }
})();
document.addEventListener("DOMContentLoaded", function () {
  window.onload = function () {
    abdeIframeHeight.init();
  }
});
window.addEventListener("orientationchange", function (event) {
  abdeIframeHeight.init();
});
